import React from 'react';

function CharacterListItem(props){
      const character=props.character;
      return( 
        <div>
           <img
            src={`${character.thumbnail}/portrait_medium.${character.thumbnail.extension}`}
            alt={character.name}
          />
        </div>
      );
}

export default CharacterListItem;
